module Collection { // ... skipped ... public fun destroy(account: &signer) acquires Collection { // account no longer has resource attached let collection = move_from<Collection>(Signer::address_of(account)); // now we must use resource value - we'll destructure it // look carefully - Items must have drop ability let Collection { items: _ } = collection; // done. resource destroyed }
