if표현식을 사용하면 일부 조건이 참인 경우 특정 코드 블록을 실행하고, 조건이 거짓인 경우 다른 블록을 실행할 수 있습니다. script { use 0x1::Debug; fun main() { let a = true; if (a) { Debug::print<u8>(&0); } else { Debug::print<u8>(&99); }; }
} 이 예시에서는 if + block 을 사용하여 a == true 인 경우 0을 출력하고 a가 false 인 경우 99 를 출력하도록 했습니다. if (<bool_expression>) <expression> else <expression>; if 구문은 이처럼 간단하며, 표현식임과 동시에 세미콜론으로 끝나야 합니다. 이는 또한 let 명령문과 함께 사용해야 하는 이유이기도 합니다! script { use 0x1::Debug; fun main() { // try switching to false let a = true; let b = if (a) { // 1st branch 10 } else { // 2nd branch 20 }; Debug::print<u8>(&b); }
} 이제 변수 b는 표현식에 따라 다른 값을 할당 받게 됩니다. 그러나 if의 두 분기점은 모두 동일한 유형을 반환해야 합니다! 그렇지 않은 경우 변수 b는 다른 유형(또는 미정의)이 될 가능성이 있으며 이는 통계적으로 입력된 언어에서는 불가능합니다. 컴파일러 용어로는 분기 호환성 이라고 하며, 양 분기가 모두 호환 가능한(동일한) 유형을 반환해야 함을 뜻합니다. if는 else 없이 단독으로 사용될 수도 있습니다. script { use 0x1::Debug; fun main() { let a = true; // only one optional branch // if a = false, debug won't be called if (a) { Debug::print<u8>(&10); }; }
} 그러나 else 분기가 없는 if 표현식은 조건이 충족되지 않은 경우 할당에 사용될 수 없으며 변수가 정의되지 않을 가능성이 존재하게 되는데, 다시 말하지만 이는 불가능합니다.

