} 그러나 컴파일러는 허용하더라도 이 키워드는 불가능합니다. script { fun main() { let i = 0; loop { if (i == 1) { // i never changed break // this statement breaks loop } }; // actually unreachable 0x1::Debug::print<u8>(&i); }
} 어느 루프가 실제로 무한인지를 이해하는 것은 컴파일러에게 있어서는 매우 복잡한 작업이기 때문에, 루프 오류를 피하는 것은 전적으로 코드 작성자인 여러분 본인에게 달려 있습니다. 앞서 말씀드렸듯이, 자산 손실로 이어질 수 있는 부분입니다.

