continue 및 break 키워드를 사용하면 각각 반복을 한 라운드 건너뛰거나 정지할 수 있습니다. 두 키워드 모두 각 유형의 루프에서 자유롭게 사용할 수 있습니다. 예를 들어 loop에 두 가지 조건을 추가해 보겠습니다. 만약 i가 짝수라면 continue를 사용함으로써 해당 키워드를 호출한 뒤 코드를 진행하는 일 없이 다음 번 반복으로 넘어 가겠습니다. break 키워드를 사용하면 반복을 멈추고 루프를 끝내게 됩니다. script { fun main() { let i = 0; loop { i = i + 1; if (i / 2 == 0) continue; if (i == 5) break; // assume we do something here }; 0x1::Debug::print<u8>(&i); }
} 세미콜론 이야기를 하자면 break와 continue가 블록 내부의 마지막 키워드라면, 이 뒤에 오는 다른 코드가 실행될 일이 없으므로 세미콜론을 붙일 수 없습니다. Semi 조차도 사용할 수 없는데, 아래 내용을 참조해 주십시오. script { fun main() { let i = 0; loop { i = i + 1; if (i == 5) { break; // will result in compiler error. correct is `break` without semi // Error: Unreachable code }; // same with continue here: no semi, never; if (true) { continue }; // however you can put semi like this, because continue and break here // are single expressions, hence they "end their own scope" if (true) continue; if (i == 5) break; } }
}

