} & 표시를 인수 유형 T에 추가하였는데, 이를 통해 인수 유형을 기존의 T로부터 T 참조 내지는 &T로 변경하였습니다. Move에서는 두 가지 유형의 참조를 지원하는데, & 로 정의되는 불변 유형 (예: &T)과 &mut에 해당하는 가변 유형 (예: &mut T)이 있습니다. 불변 참조는 값을 변경하지 않고 읽을 수 있게 합니다. 반면 가변 유형은 값을 읽고 변경할 수 있습니다. module M { struct T { value: u8 } // returned value is of non-reference type public fun create(value: u8): T { T { value } } // immutable references allow reading public fun value(t: &T): u8 { t.value } // mutable references allow reading and changing the value public fun change(t: &mut T, value: u8) { t.value = value; }
} 이제 업그레이드된 모듈 M을 어떻게 사용할지를 보겠습니다. script { use {{sender}}::M; fun main() { let t = M::create(10); // create a reference directly M::change(&mut t, 20); // or write reference to a variable let mut_ref_t = &mut t; M::change(mut_ref_t, 100); // same with immutable ref let value = M::value(&t); // this method also takes only references // printed value will be 100 0x1::Debug::print<u8>(&value); }
} 불변(&) 참조를 사용하면 구조체로부터 데이터를 읽을 수 있으며, 가변(&mut)을 사용하면 이를 변경할 수 있습니다. 적절한 참조 유형을 사용함을 통해 보안성을 유지할 수 있으며 모듈 판독을 보조하여 독자들로 하여금 해당 메서드가 값을 변경하는지 아니면 읽기만 진행하는지를 알 수 있게 합니다.

