Move는 참조를 사용하는 방식을 제어하며 예기치 못한 참사가 일어나는 일을 막도록 도와줍니다. 예시를 통해 이해해 봅시다. 모듈과 스크립트를 보면서 무슨 일이 일어나는지, 그리고 그 이유는 무엇인지를 함께 생각해 보겠습니다. module Borrow { struct B { value: u64 } struct A { b: B } // create A with inner B public fun create(value: u64): A { A { b: B { value } } } // give a mutable reference to inner B public fun ref_from_mut_a(a: &mut A): &mut B { &mut a.b } // change B public fun change_b(b: &mut B, value: u64) { b.value = value; }
} script { use {{sender}}::Borrow; fun main() { // create a struct A { b: B { value: u64 } } let a = Borrow::create(0); // get mutable reference to B from mut A let mut_a = &mut a; let mut_b = Borrow::ref_from_mut_a(mut_a); // change B Borrow::change_b(mut_b, 100000); // get another mutable reference from A let _ = Borrow::ref_from_mut_a(mut_a); }
} 이 코드는 컴파일이 진행되며 오류 없이 작동합니다. 먼저 여기에서 일어나고 있는 일은 가변 참조를 A에 사용하여 내부 구조체인 B에 가변 참조를 적용할 수 있도록 합니다. 그 뒤에 B를 변경하고, 계속 작업을 반복할 수 있습니다. 하지만 마지막 두 표현식을 바꾸어 B로의 가변 참조가 남아 있는 상태에서 A에 새로 가변 참조를 생성하려고 시도하면 어떻게 될까요? let mut_a = &mut a;
let mut_b = Borrow::ref_from_mut_a(mut_a); let _ = Borrow::ref_from_mut_a(mut_a); Borrow::change_b(mut_b, 100000); 아마 오류가 발생했을 것입니다. ┌── /scripts/script.move:10:17 ─── │ 10 │ let _ = Borrow::ref_from_mut_a(mut_a); │ ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ Invalid usage of reference as function argument. Cannot transfer a mutable reference that is being borrowed · 8 │ let mut_b = Borrow::ref_from_mut_a(mut_a); │ ----------------------------- It is still being mutably borrowed by this reference │ 코드가 컴파일되지 않을 것입니다. 그 이유는 &mut A가 &mut B에 의해 차용되고 있기 때문입니다. 만약 내용에 대한 가변 참조를 확보한 상태에서 A를 변경할 수 있게 된다면, 내용에 대한 참조가 여전히 여기 존재하는 상황에서 A가 변경된다는 이상한 상황이 발생하게 됩니다. B가 실제로 존재하지 않는데 mut_b가 어딜 지정해야 하는 걸까요? 이로써 몇 가지 결론이 도출됩니다. 컴파일 에러가 일어나게 되는데, 즉 Move 컴파일러는 이런 사례들을 방지한다는 것을 뜻합니다. 이는 차용 확인 이라고 하는 기능입니다(원본은 Rust 언어의 개념). 컴파일러는 차용 그래프 를 축적하여 차용된 값을 이동 하는 것은 허용하지 않습니다. 이는 Move를 블록체인에서 사용하기에 안전한 이유 중 하나입니다. 참조에서 참조를 생성하는 것도 가능하므로, 원본 참조는 신규 참조에서 차용 하게 됩니다. 불변 및 가변 참조는 불변에서, 가변 참조는 가변에서만 생성할 수 있습니다. 참조가 차용된 경우 다른 값들도 연결되어 있으므로 이동 시킬 수 없습니다.

