참조는 별표 *를 사용하여 연결된 값에서 참조 해제를 진행할 수 있습니다. 참조를 해제하는 경우에는 사본 을 생성하게 됩니다. 해당 값에 복사 능력이 있는지를 확인하세요. module M { struct T has copy {} // value t here is of reference type public fun deref(t: &T): T { *t }
} 참조 해제 연산자는 원본 값을 현재의 스코프로 이동해 주지 않습니다. 대신 이 값의 사본 을 생성합니다. Move에서 구조체의 내부 필드를 복사하기 위해 사용할 수 있는 기법이 하나 있는데, 바로 *&입니다. 필드에 대한 참조를 해제하는 것입니다. 여기 짧은 예시가 있습니다. module M { struct H has copy {} struct T { inner: H } // ... // we can do it even from immutable reference! public fun copy_inner(t: &T): H { *&t.inner }
} By using *& (even compiler will advise you to do so) we've copied the inner value of a struct. *&를 사용하면 구조체의 내부 값을 복사하게 됩니다(컴파일러에서도 권장하는 기능입니다).

