} 이 상자는 u64 유형의 값만 저장할 수 있다는 건 자명한 사실입니다. 그러나 동일한 상자를 u8 유형이나 bool형에 대응하도록 생성하고 싶다면 어떻게 할까요? Box1과 Box2를 생성하는 게 좋을까요? 아니면 다른 모듈을 발행해야 할까요? 둘 다 오답입니다. 제네릭을 사용하면 되니까요. module Storage { struct Box<T> { value: T }
} 구조체 이름 옆에 <T>를 입력했습니다. 부등호 기호 <..>들은 제네릭의 유형을 정의하기 위해 사용하며, T는 이 구조체에서 우리가 견본으로 삼은 유형에 해당합니다. 구조체 바디 정의 내부에서는 T를 일반 유형으로 사용했습니다. T라는 유형은 실존하는 것이 아니라, 모든 유형 이 들어올 수 있도록 하는 문자입니다.

