이제 u64 유형을 우선 값으로 사용할 이 구조체에 생성자를 생성하겠습니다. module Storage { struct Box<T> { value: T } // type u64 is put into angle brackets meaning // that we're using Box with type u64 public fun create_box(value: u64): Box<u64> { Box<u64>{ value } }
} 제네릭은 명시된 유형 매개 변수를 가져야 하기 때문에 약간 더 복잡한 정의를 지니는데, 따라서 일반 구조체 Box는 Box<u64>가 됩니다. 제네릭의 부등호 기호 안에는 모든 유형을 전달할 수 있습니다. create_box메서드를 더욱 일반성을 띠도록 하여 사용자들이 유형을 명시할 수 있게 처리해 줍시다. 다른 제네릭을 함수 서명에 활용함으로써 말입니다 module Storage { // ... public fun create_box<T>(value: T): Box<T> { Box<T> { value } } // we'll get to this a bit later, trust me public fun value<T: copy>(box: &Box<T>): T { *&box.value }
}

