능력 에 대해 앞서 배웠는데, 제네릭에서는 능력을 “확인” 하거나 제약 하게 됩니다. 제약의 경우 대응하는 능력에 따라 이름이 결정됩니다. fun name<T: copy>() {} // allow only values that can be copied
fun name<T: copy + drop>() {} // values can be copied and dropped
fun name<T: key + store + drop + copy>() {} // all 4 abilities are present ...또는 구조체의 경우 struct name<T: copy + drop> { value: T } // T can be copied and dropped
struct name<T: store> { value: T } // T can be stored in global storage 다음 구문을 숙지 바랍니다. +(plus)부호는 처음부터 직관적이지 않을 수 있으나, Move의 키워드 목록에서 유일하게 +를 사용하는 곳입니다. 제약이 걸린 시스템의 예시입니다. module Storage { // contents of the box can be stored struct Box<T: store> has key, store { content: T }
} 또한 내부 유형(또는 제네릭 유형)은 반드시 컨테이너의 능력(key를 제외한 모든 능력이 해당)을 가져야 한다는 점도 숙지해 두십시오. 조금만 생각해 보면 모든 부분은 상식적이고 직관적입니다. copy(복사) 능력이 있는 구조체라면 내용 또한 복사 능력을 가져야 합니다. 그렇지 않다면 컨테이너 객체가 복사가능한 것으로 간주될 수 없을 것입니다. Move 컴파일러는 이 논리를 따르지 않는 코드도 컴파일하도록 허용하겠지만 해당 능력들은 사용할 수 없게 될 것입니다. 다음의 예시를 참조하십시오. module Storage { // non-copyable or droppable struct struct Error {} // constraints are not specified struct Box<T> has copy, drop { contents: T } // this method creates box with non-copyable or droppable contents public fun create_box(): Box<Error> { Box { contents: Error {} } }
} 이 코드는 성공적으로 컴파일 및 발행이 진행되었습니다. 그러나 실행해 보게 되면… script { fun main() { {{sender}}::Storage::create_box() // value is created and dropped } } Box가 제외할 수 없다는 오류가 출력됩니다. ┌── scripts/main.move:5:9 ─── │ 5 │ Storage::create_box(); │ ^^^^^^^^^^^^^^^^^^^^^ Cannot ignore values without the 'drop' ability. The value must be used │ 이런 일이 발생하는 이유는 내부 값에 제외 능력이 없기 때문입니다. 컨테이너의 능력은 내용에 의해 자동으로 제한이 되므로, 예를 들어 복사, 제외 및 저장 능력을 가진 컨테이너 구조체가 있고 내부 구조체에는 제외 능력밖에 없다면 해당 컨테이너를 복사하거나 저장하는 것은 불가능할 것입니다. 또 다른 관점에서 볼 때 이 컨테이너는 내부 유형에 대한 제약 사항을 가질 필요가 없이, 내부에 어떤 유형이 들어있든지 사용될 수 있는 유연성을 확보하는 것도 가능합니다. 그러나 실수를 피하기 위해 항상 점검을 게을리하지 말고, 필요하다면 함수와 구조체에서 제네릭 관련 제약사항을 명시하는 것이 좋습니다. 아래 구조체가 보다 안전한 예시가 되겠습니다. // we add parent's constraints
// now inner type MUST be copyable and droppable
struct Box<T: copy + drop> has copy, drop { contents: T
}

