벡터는 또한 스트링을 대표하는 역할을 맡습니다. VM은 스크립트 상 main 함수에 vector<u8>을 인수로 전달하는 방법을 지원합니다. 그러나16진법 리터럴을 사용하여 스크립트나 모듈에서 vector<u8>을 정의할 수도 있습니다. script { use 0x1::Vector; // this is the way to accept arguments in main fun main(name: vector<u8>) { let _ = name; // and this is how you use literals // this is a "hello world" string! let str = x"68656c6c6f20776f726c64"; // hex literal gives you vector<u8> as well Vector::length<u8>(&str); }
} Bytestring 리터럴을 사용하면 좀 더 단순하게 접근할 수 있습니다. script { fun main() { let _ = b"hello world"; }
} ASCII 스트링으로 취급되며 마찬가지로 vector<u8>로 해석됩니다.

