네이티브 유형은 네이티브 함수를 필요로 하고, signer 유형의 경우에는 0x1::Signer 입니다. 해당 모듈은 비교적 단순합니다. ( Diem에서 원본 모듈에 대한 링크 ): module Signer { // Borrows the address of the signer // Conceptually, you can think of the `signer` // as being a resource struct wrapper arround an address // ``` // resource struct Signer { addr: address } // ``` // `borrow_address` borrows this inner field native public fun borrow_address(s: &signer): &address; // Copies the address of the signer public fun address_of(s: &signer): address { *borrow_address(s) }
} 보다시피 2개의 메소드가 있으며 그 중 하나는 네이티브이고, 다른 하나는 역참조 연산자를 사용하여 주소를 복사하기에 보다 간편합니다. 모듈을 사용하는 것 역시 이처럼 단순합니다. script { fun main(account: signer) { let _ : address = 0x1::Signer::address_of(&account); }
}
